import React, { Component, createRef } from 'react'

export default class Login extends Component {

  email = createRef()
  password = createRef()

  HendelSubmit = (e) => {
      console.log('email', this.email.current.value);
    }


  render() {
    return (
      <div className='container mt-4'>
        <form className='form-control' onSubmit={this.HendelSubmit}>
           <div className='m-3'>
             <label htmlFor="InputEmail" className='form-lable'> Email:</label>
            <input ref={this.email} id='InputEmail' type="text" className='form-control mt-1'/>
             <label htmlFor="InputPassword" className='form-lable'> Password:</label>
            <input ref={this.password} value='this value inpute...' id='InputPassword' type="password" className='form-control mt-1' placeholder='*****' />
              <button className='btn btn-primary mt-4' type='submit' >submit</button>
           </div>
        </form>
      </div>
    )
  }
}
